## Proposed changes

Issue Number: close #xxx
The indexes of OlapTable may not be assigned in method `readFields`:
```
@Override
public void readFields(DataInput in) throws IOException {
    ...
    // read indexes
    if (in.readBoolean()) {
        this.indexes = TableIndexes.read(in);
    }
    ...
}
```
So indexes may be null.
